import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
    const [message, setMessage] = useState('');

    useEffect(() => {
        axios.get('http://127.0.0.1:5000/api/data')  // Flask API endpoint
            .then(response => {
                setMessage(response.data.message);  // Handle the response
            })
            .catch(error => {
                console.error('Error fetching data:', error);  // Log any errors
            });
    }, []);

    return (
        <div>
            <h1>React + Flask Integration</h1>
            <p>{message}</p>
        </div>
    );
}

export default App;
